import THREE from 'three.js'; 
import dat   from 'dat-gui' ;
import Stats from 'stats-js' ;
import MathP from 'utils-perf';

const OrbitControls = require('three-orbit-controls')(THREE);
const SSAOShader     = require('./postprocessing/SSAOShader')(THREE);
const EffectComposer = require('./postprocessing/core/EffectComposer')(THREE);
const RenderPass = require('./postprocessing/core/RenderPass')(THREE);

class Demo {
  constructor(args) 
  {
    this.spin = 70;
    this.numCircles = 310;
    this.thickness = .2;
    this.radius = 120;
    this.circles = [];
    this.useColor = false;
    this.rotateBothAxis = true;
    this.wireframe = true;
    this.clamp = .5;
    this.lumInfluence = 19.5;
    this.segments = 60;
    this.onlySSAO = false;

    this.startStats();
    this.startGUI();

    this.map = "data:image/png;base64,";

    this.renderer = null;
    this.camera   = null;
    this.scene    = null;
    this.counter  = 0;
    this.clock    = new THREE.Clock();


    this.createRender();
    this.createScene();
    this.createComposer();
    this.addObjects();

    this.onResize();
    this.update();
  }

  startStats()
  {
    this.stats = new Stats(); 
    this.stats.domElement.style.position = 'absolute';
    document.body.appendChild(this.stats.domElement);
  }

  createRender()
  {
    this.renderer = new THREE.WebGLRenderer( {
        antialias : true,
        clearColor: 0, 
    } );
    this.renderer.autoClear = false;
    this.renderer.gammaInput = true;
    document.body.appendChild(this.renderer.domElement)
  }

  createScene()
  {
    this.camera = new THREE.PerspectiveCamera(45, window.innerWidth / window.innerHeight, 0.01, 4000 );
    this.camera.position.set(0, 0, 200);
    this.controls = new OrbitControls(this.camera, this.renderer.domElement);
    this.controls.autoRotate = true;
    this.controls.autoRotateSpeed = 4;
    this.controls.maxDistance = 500;

    this.scene = new THREE.Scene();
  }

  createComposer()
  {
    this.composer = new EffectComposer(this.renderer);
    this.composer.addPass( new THREE.RenderPass( this.scene, this.camera ) );

    var renderPass = new THREE.RenderPass( this.scene, this.camera );
    var depthShader = THREE.ShaderLib[ "depthRGBA" ];
    var depthUniforms = THREE.UniformsUtils.clone( depthShader.uniforms );

    this.depthMaterial = new THREE.ShaderMaterial( { fragmentShader: depthShader.fragmentShader, vertexShader: depthShader.vertexShader,
      uniforms: depthUniforms, blending: THREE.NoBlending } );

    var pars = { minFilter: THREE.LinearFilter, magFilter: THREE.LinearFilter };
    this.depthRenderTarget = new THREE.WebGLRenderTarget( window.innerWidth, window.innerHeight, pars );

    // Setup SSAO pass
    this.ssaoPass = new THREE.ShaderPass( THREE.SSAOShader );
    this.ssaoPass.renderToScreen = true;
    this.ssaoPass.uniforms[ "tDepth" ].value = this.depthRenderTarget;
    this.ssaoPass.uniforms[ 'size' ].value.set( window.innerWidth, window.innerHeight );
    this.ssaoPass.uniforms[ 'cameraNear' ].value = this.camera.near;
    this.ssaoPass.uniforms[ 'cameraFar' ].value = this.camera.far;
    this.ssaoPass.uniforms[ 'onlyAO' ].value = this.onlySSAO;
    this.ssaoPass.uniforms[ 'aoClamp' ].value = this.clamp;
    this.ssaoPass.uniforms[ 'lumInfluence' ].value = this.lumInfluence;

    this.composer.addPass( this.ssaoPass );
  }

  generateMaterial(color)
  {
    return new THREE.MeshPhongMaterial({ blending: THREE.AdditiveBlending,  map: THREE.ImageUtils.loadTexture(this.map), color : color, wireframe: this.wireframe});
  }

  addObjects()
  {
    // var gridHelper = new THREE.GridHelper( 100, 10 );        
    // this.scene.add( gridHelper );

    this.materials = [];

    this.whiteMaterial = new THREE.MeshPhongMaterial({ blending: THREE.AdditiveBlending, map: THREE.ImageUtils.loadTexture(this.map),  color : 0xFFFFFF, wireframe: this.wireframe});

    let light = new THREE.DirectionalLight(0xcccccc, .5);
    light.position.set(0, 0, 5);

    this.scene.add(light);

    // let colours = [0x1ABC9C, 0x2ECC71, 0x3498DB, 0x9B59B6, 0x34495D, 0xF1C40F, 0xE47E30, 0xE74C3C, 0xBDC3C7]
    let colours = [0xD04836, 0x3C73AB, 0x39D2EC, 0xFDBE42, 0x20ADC4]
    for (var i = 0; i < colours.length; i++) {
      this.materials.push(this.generateMaterial(colours[i]));
    };

    this.createCircles();

  }

  createCircles()
  {
    this.circleGeometry = new THREE.BufferGeometry().fromGeometry(new THREE.RingGeometry( this.radius, this.radius + this.thickness, this.segments >> 0 ));

    let i = 0;

    for (i = 0; i < this.circles.length; i++) this.scene.remove(this.circles[i]);

    this.circles = [];

    let angle = (360 / this.numCircles) * (Math.PI / 180);

    for (i = 0; i < this.numCircles; i++) {
      var circle = new THREE.Mesh( this.circleGeometry, this.useColor ? this.materials[i%(this.materials.length-1)] : this.whiteMaterial );
      let scale = (i / this.numCircles);
      circle.scale.set(scale, scale, scale);
      this.scene.add( circle );
      if(i % 2 == 0)
      {
        circle.rotation.y = angle * i + (this.spin / (100 * i));
      } else {
        circle.rotation.x = angle * i + (this.spin / (100 * i));
      }

      this.circles.push(circle);
    };

  }

  startGUI()
  {
    var gui = new dat.GUI()
    gui.add(this, 'spin', 1, 200);
    gui.add(this, 'thickness', 0.001, .5).onChange(this.createCircles.bind(this));
    gui.add(this, 'numCircles', 1, 500).onChange(this.createCircles.bind(this));
    gui.add(this, 'radius', 1, 200).onChange(this.createCircles.bind(this));
    gui.add(this, 'useColor').onChange(this.createCircles.bind(this));
    gui.add(this, 'rotateBothAxis').onChange(this.createCircles.bind(this));

    gui.add(this, 'segments', 1, 60).onChange(this.createCircles.bind(this));
    // gui.add(this, 'clamp', 0.01, 100);
    gui.add(this, 'lumInfluence', 0, 100);
    gui.add(this, 'onlySSAO');

    gui.open();
  }

  update()
  {
    this.stats.begin();
    let time = this.clock.getElapsedTime();

    for (var i = 0; i < this.circles.length; i++) {

      if(this.rotateBothAxis)
      {
        if(i % 2 == 0)
        {
          this.circles[i].rotation.y += (this.spin / (100 * i));
          
        } else {
          this.circles[i].rotation.x += -(this.spin / (100 * i));
        }
      } else {
        this.circles[i].rotation.x += -(this.spin / (100 * i));
      }
    };

    this.scene.overrideMaterial = this.depthMaterial;

    // this.ssaoPass.uniforms[ 'aoClamp' ].value = this.clamp;
    this.ssaoPass.uniforms[ 'lumInfluence' ].value = this.lumInfluence;
    this.ssaoPass.uniforms[ 'onlyAO' ].value = this.onlySSAO;

    this.renderer.render( this.scene, this.camera, this.depthRenderTarget, true );

    this.scene.overrideMaterial = null;
    this.composer.render();

    this.stats.end()
    requestAnimationFrame(this.update.bind(this));
  }

  onResize()
  {
    this.composer.setSize(window.innerWidth, window.innerHeight);
    this.renderer.setSize(window.innerWidth, window.innerHeight);
    this.camera.aspect = window.innerWidth / window.innerHeight;
    this.camera.updateProjectionMatrix();
  }
}

export default Demo;